    const utente = useSelector(state => state.utente);
    const conto = useSelector(state => state.conto);
    const history = useHistory();


    function visualSideBar(){
        
    return(
        (utente.ruolo) ?
        
        (utente.ruolo.id==1) ? (
            <div class="sidebar">
            <h1>CIAO ADMIN</h1>
            </div>
        ) : (
            <div class="sidebar">
            <h1>CIAO UTENTE</h1>
            </div>  
        ): null
    )
        
    }


return(
    <>
    
    
    <nav class="navbar">
        <h1 className="h1-navbar">Benvenuto in ExoBank</h1>
    </nav>

    {visualSideBar()}
    
    
    
    
    
    
    
    </>
)





}
